import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import SignIn from "./signin";
import SignUp from "./signup";
import Dashboard from "./Dashboard";
import ExamPage from "./ExamPage";
import ExamSelection from "./ExamSelection";
import Guideline from "./Guideline";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<SignIn />} />
        <Route path="/register" element={<SignUp />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/exam-selection" element={<ExamSelection />} />
        <Route path="/guideline/:examId" element={<Guideline />} /> 
        <Route
  path="/start-exam/:examId"
  element={
    <ExamPage
      studentName={user.name} // Ensure user.name is not undefined
      studentEmail={user.email} // Ensure user.email is not undefined
      testName="Sample Test Name"
    />
  }
/>

        <Route path="/start-exam/:examId" element={<ExamPage />} />
        <Route path="*" element={<h1>404 Not Found</h1>} />
        <Route path="/" element={<h1>Home page</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
